INSERT INTO `facilities` (`fid`, `f_title`, `f_content`, `f_path`) VALUES (1,'COMPUTER EDUCATION','The days is a computer age, so all the student are compulsory for computer education with the well equip computer separate class room and library. All students get ample opportunity to handle computers and gain knowledge about latest hardware and software.','computer.jpg'),(2,'SCHOOL CAMPUS','The school is located in a picturesque area at a distance of 22 km. from Imphal on National Highway 102 (Indo Myanmar Road ) in Thoubal District of Manipur. The school campus, spread over an area 0.62 acre is suitably developed to provide a screened environment and sound infrastructure.','campus.jpg'),(3,'ENTERTAINMENT','Adequate arrangement have been provided for healthy entertainment to students. Select movies are screened twice in a week. Co-curricular activities like musical evenings, drama shows, recitation, ex-tempore speech and quiz programs etc. are also organized which provides a source of entertainment and knowledge to the students.','swimming.jpg'),(4,'CO-CURRICULAR ACTIVITIES','While major emphasis is laid on the academic programs of the students, the school also provides ample scope for the development of their creative faculties. Students are motivated to learn by doing and participating in various activities according to the aptitude. The school has the following hobby clubs.','playing.jpg');
