INSERT INTO `page_master` (`page_id`, `page_name`, `page_link`, `parent_id`, `page_content`, `page_photo`, `srl`, `show_tag`) VALUES (28,'About','',0,'<p style=\"text-align: justify;\"><span><span style=\"font-size: x-large; color: #ff0000;\">T</span>he scheme of establishing Peace and Freedom Academy is mainly to bring Peace, Freedom and solidarity in the state of Manipur where the present situation is connected. Ofcourse the student reading in the state of Manipur are never got peace mind and freedom of study, but we (administrator )are always thinking to give peace mind and freedom of study in a tied security and well fence school campus. The school is located in a picturesque area at a distance of 22 km. from Imphal on National Highway 102 (Indo Myanmar Road ) in Thoubal District of Manipur. The school campus, spread over an area 0.62 acre is suitably developed to provide a screened environment and sound infrastructure. A highly qualified experienced and trained and self-motivated teachers both Manipuri and non-Manipuri. Overall local committee of Administration meets at regular intervals to review the progress of the school and to adopt measures for its improvement.</span></p>',NULL,1,'T'),(30,'Notice Board','',0,'',NULL,2,'T'),(31,'Academic','',0,'',NULL,3,'T'),(32,'Admission','',31,'<h3 class=\"heading-large\">SCHOOL EXEMPTION SCHEMES</h3>\r\n<table class=\"table table-striped table-bordered\">\r\n<thead>\r\n<tr><th>Sl. No.</th><th>No. of students admitted from same parents/others</th><th>No. &amp; kind of students to be concessioned</th><th>Concession/ exemption schemes</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>1</td>\r\n<td align=\"center\">2</td>\r\n<td align=\"center\">1</td>\r\n<td>Half of Annual T/Fee</td>\r\n</tr>\r\n<tr>\r\n<td>2</td>\r\n<td align=\"center\">3</td>\r\n<td align=\"center\">1</td>\r\n<td>Complete Annual T/Fee</td>\r\n</tr>\r\n<tr>\r\n<td>3</td>\r\n<td align=\"center\">4</td>\r\n<td align=\"center\">1</td>\r\n<td>Half of Annual T/Fee</td>\r\n</tr>\r\n<tr>\r\n<td>4</td>\r\n<td align=\"center\">-</td>\r\n<td align=\"center\">BPL card Holder</td>\r\n<td>10% of Annual T/Fee</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span><span>Note:</span>&nbsp;</span>Students must submit BPL card to the office during admission in the month of Jan. 2018 only. The old students who had submitted BPL card in the previous year must submit again during admission.</p>',NULL,11,'T'),(33,'Prayer','',31,'<p><span>Our Father in Heaven-&nbsp;</span><br /><span>Hallowed be Thy name-&nbsp;</span><br /><span>Thy kingdom come-&nbsp;</span><br /><span>Thy will be done on earth&nbsp;</span><br /><span>as it is in Heaven.&nbsp;</span><br /><span>Give us today our daily bread.&nbsp;</span><br /><span>Forgive us our sin -&nbsp;</span><br /><span>As we forgive those who&nbsp;</span><br /><span>sin against us.&nbsp;</span><br /><span>Lead us not into temptations-&nbsp;</span><br /><span>But deliver us form evil.&nbsp;</span><br /><span>Amen!</span></p>',NULL,2,'T'),(34,'Anthem','',31,'<p><span>Ngashigi Anganba Ayukse&nbsp;</span><br /><span>Sana mani muktatagi&nbsp;</span><br /><span>Tansilhoushi lepsilhoushi&nbsp;</span><br /><span>Watta-padaba phougei chengei&nbsp;</span><br /><span>Lepsilhourasi Tansilhourasi&nbsp;</span><br /><span>Khangda-Uda pumba takpiro&nbsp;</span><br /><span>Guru Oja Guru&nbsp;</span><br /><span>He Ima Peace And Freedom Academy&nbsp;</span><br /><span>Ima nangna takpiyu nachasingda&nbsp;</span><br /><span>Ima nangna lamjingbiyu nachasingbu&nbsp;</span><br /><span>Aphaba lambi, phattaba lambi&nbsp;</span><br /><span>Chaheidaba pot, Ngangheidaba wa&nbsp;</span><br /><span>Thakshi-khashi, Ima-Ipa&nbsp;</span><br /><span>Khngda-uda pumba takpiro&nbsp;</span><br /><span>Guru Oja Guru&nbsp;</span><br /><span>Nachasingna chaoba sarep pharaklaga&nbsp;</span><br /><span>Imannabasingdagi athoiba oinaba&nbsp;</span><br /><span>Malemgi phambakthakta Iromdom lepnaba&nbsp;</span><br /><span>Pangal-thouna mayeng tadaba&nbsp;</span><br /><span>Akhang-kanba, napari namom&nbsp;</span><br /><span>Mithoi mihenba oinanaba.&nbsp;</span><br /><span>Khngda-uda pumba takpiro&nbsp;</span><br /><span>Guru Oja Guru&nbsp;</span><br /><span><span>Lyrics :&nbsp;</span>S B SINGH (Managing Director)</span></p>',NULL,3,'T'),(35,'School Uniforms','',31,'<table class=\"table table-striped table-bordered\">\r\n<thead>\r\n<tr><th>Category</th><th>Dresses</th><th>Day</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>Formal Dress (Boys)</td>\r\n<td>Grey long pant, Sky blue shirt, Grey waist coat, Blue sweater, Black shoes, Black socks, Stripped neck tie &amp; Belt</td>\r\n<td>Monday, Tuesday, Thursday &amp; Friday</td>\r\n</tr>\r\n<tr>\r\n<td>Formal Dress (Girls)</td>\r\n<td>Grey skirt (Pre-Nry to Cl-V), Grey Phanek (Cl-VI to Cl-X), Sky blue shirt, Waist coat, Blue sweater, Black shoes, Black socks, Red ribbon, Stripped Neck tie &amp; Belt</td>\r\n<td>Monday, Tuesday, Thursday &amp; Friday</td>\r\n</tr>\r\n<tr>\r\n<td>Casual Dresses (Boys)</td>\r\n<td>white longpant, Red/Blue T-shirt, White shoes, White socks, Stripped Belt</td>\r\n<td>Wednesday and Saturday</td>\r\n</tr>\r\n<tr>\r\n<td>Casual Dresses (Girls)</td>\r\n<td>Pink Phanek (Cl-VI to X), White skirt &amp; Stripped Belt (Pre-Nry to Cl-V),Red/Blue T-shirt, White shoes, White socks, Blue Ribbon</td>\r\n<td>Wednesday and Saturday</td>\r\n</tr>\r\n<tr>\r\n<td>Sport Dresses</td>\r\n<td>White short/Tracksuit, White T-shirt, Converse shoes and White socks</td>\r\n<td>On the sport day</td>\r\n</tr>\r\n</tbody>\r\n</table>',NULL,4,'T'),(36,'Rules and Regulations','',31,'',NULL,5,'F'),(37,'School Acclamation','',31,'',NULL,6,'F'),(38,'Infrastructure','',0,'',NULL,4,'T'),(39,'Campus','',38,'',NULL,1,'T'),(40,'Boarding','',38,'<div class=\"row\">\r\n<div class=\"col-md-12 table-responsive\">\r\n<h3 class=\"heading-large\">DAILY DRESSING DAY</h3>\r\n<hr />\r\n<table class=\" table table-striped table-bordered\">\r\n<thead>\r\n<tr><th scope=\"col\">DAYS</th><th scope=\"col\">4:00 a.m. to 8:00 a.m.</th><th scope=\"col\">8:00 a.m. to 3:00 p.m.</th><th scope=\"col\">3:00 p.m. to 5:00 p.m.</th><th scope=\"col\">5:00 p.m. to 8:30 p.m.</th><th scope=\"col\">8:30 p.m. to 4:30 a.m.</th><th scope=\"col\" colspan=\"3\">Bed Sheets &amp; Pillow Cover</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr><th scope=\"row\">&nbsp;</th>\r\n<td>Track Suit, Black Snicker &amp; Grey Socks</td>\r\n<td>School Uniform</td>\r\n<td>Formal Quarter Pant Civil Dress</td>\r\n<td>Track Suits Black Snicker and Grey Socks</td>\r\n<td>Night Dress</td>\r\n<td>Day</td>\r\n<td>Night</td>\r\n<td>To be Wash</td>\r\n</tr>\r\n<tr><th scope=\"row\">Sunday</th>\r\n<td>Track Suit, Green T-Shirt, Black snicker, &amp; Grey socks</td>\r\n<td style=\"text-align: center;\" colspan=\"2\">Green T-Shirts and Black Pant</td>\r\n<td>Track Suit, Black Sniker, Green T-Shirt and Grey Socks</td>\r\n<td>Grey</td>\r\n<td>Yellow</td>\r\n<td>Navy Blue</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr><th scope=\"row\">Monday</th>\r\n<td>Track Suit, Green T-Shirt, Black Sniker &amp; Grey Socks</td>\r\n<td>T-Shirts &amp; White Pant/Skirt</td>\r\n<td>Casual Summer Dress</td>\r\n<td>Track Suit, Green T-Shirt and Black Pant</td>\r\n<td>Grey</td>\r\n<td>Yellow</td>\r\n<td>Navy Blue</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr><th scope=\"row\">Tuesday</th>\r\n<td>Track Suit, Red Shirt, Black Snicker &amp; Grey Socks</td>\r\n<td>Sky Blue Shirt, Tie, Grey Pant/Skirt</td>\r\n<td>&nbsp;</td>\r\n<td>Track Suit, Red T-Shirt and Blue Navy Pant</td>\r\n<td>Grey</td>\r\n<td>Yellow</td>\r\n<td>Navy Blue</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr><th scope=\"row\">Wednesday</th>\r\n<td>Track Suit, Red T-Shirt, Black Snicker &amp; Grey Socks</td>\r\n<td>\r\n<p>Sky Blue Shirt, Tie, Grey Pant/Skirt</p>\r\n</td>\r\n<td>&nbsp;</td>\r\n<td>Track Suit, Red T-Shirt and Blue Navy Pant</td>\r\n<td>Grey</td>\r\n<td>Yellow</td>\r\n<td>Navy Blue</td>\r\n<td>Washing</td>\r\n</tr>\r\n<tr><th scope=\"row\">Thursday</th>\r\n<td>Track Suit, Green T-Shirt, Black Sniker &amp; Grey socks</td>\r\n<td>\r\n<p>T-Shirts &amp; White Pant/Skirt</p>\r\n</td>\r\n<td>Casual Summer Dress</td>\r\n<td>Track Suit, Green T-Shirt and</td>\r\n<td>Grey</td>\r\n<td>Yellow</td>\r\n<td>Navy Blue</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr><th scope=\"row\">Friday</th>\r\n<td>Track Suit, Red T-Shirt, Black Snicker &amp; Grey Socks</td>\r\n<td>Sky Blue Shirt, Tie, Grey Pant/Skirt</td>\r\n<td>Casual Summer Dress</td>\r\n<td>Track Suit, Green T-Shirt and Black Pant</td>\r\n<td>Grey</td>\r\n<td>Yellow</td>\r\n<td>Navy Blue</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr><th scope=\"row\">Saturday</th>\r\n<td>Track Suit, Red T-Shirt, Black Snicker &amp; Grey Socks</td>\r\n<td>Sky Blue Shirt, Tie |Grey Pant/Skirt</td>\r\n<td>&nbsp;</td>\r\n<td>Track Suit, Red T-Shirt and Navy Blue Pant</td>\r\n<td>Grey</td>\r\n<td>Yellow</td>\r\n<td>Navy Blue</td>\r\n<td>Washing</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div class=\"col-md-12 table-responsive\">\r\n<h3 class=\"heading-large\">DAILY DRESSING DAY</h3>\r\n<hr />\r\n<table class=\" table table-striped table-bordered\">\r\n<tbody>\r\n<tr>\r\n<td>1.</td>\r\n<td>Wake up Call</td>\r\n<td>4:30 a.m.</td>\r\n</tr>\r\n<tr>\r\n<td>2.</td>\r\n<td>Wash up</td>\r\n<td>4:30 a.m. to 4:45 a.m.</td>\r\n</tr>\r\n<tr>\r\n<td>3.</td>\r\n<td>Devotion / PT / Yoga</td>\r\n<td>4:45 a.m. to 5:00 a.m.</td>\r\n</tr>\r\n<tr>\r\n<td>4.</td>\r\n<td>Tea Break</td>\r\n<td>5:00 a.m. to 5:15 a.m.</td>\r\n</tr>\r\n<tr>\r\n<td>5.</td>\r\n<td>Morning Study</td>\r\n<td>5:15 a.m. to 7:45 a.m.</td>\r\n</tr>\r\n<tr>\r\n<td>6.</td>\r\n<td>Bathing / Dress up</td>\r\n<td>7:45 a.m. to 8:05 a.m.</td>\r\n</tr>\r\n<tr>\r\n<td>7.</td>\r\n<td>Lunch</td>\r\n<td>8:05 to 8:35 a.m.</td>\r\n</tr>\r\n<tr>\r\n<td>8.</td>\r\n<td>Mass Prayer &amp; on to school</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\">\r\n<div align=\"center\">AFTER SCHOOL</div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>9.</td>\r\n<td>Exposing Shoes, Socks and Tea Break</td>\r\n<td>3:00 p.m. to 3:20 p.m.</td>\r\n</tr>\r\n<tr>\r\n<td>10.</td>\r\n<td>Rest</td>\r\n<td>3:20 p.m. to 4:00 p.m.</td>\r\n</tr>\r\n<tr>\r\n<td>11.</td>\r\n<td>Games &amp; Sports</td>\r\n<td>3:20 p.m. to 4:30 p.m.</td>\r\n</tr>\r\n<tr>\r\n<td>12.</td>\r\n<td>Bathing</td>\r\n<td>4:30 p.m. to 5:00 p.m.</td>\r\n</tr>\r\n<tr>\r\n<td>13.</td>\r\n<td>Dinner</td>\r\n<td>5:00 p.m. to 5:30 p.m.</td>\r\n</tr>\r\n<tr>\r\n<td>14.</td>\r\n<td>Evening Study</td>\r\n<td>5:30 p.m. to 8:30 p.m.</td>\r\n</tr>\r\n<tr>\r\n<td>15.</td>\r\n<td>Roll Call Assembly</td>\r\n<td>8:30 p.m. to 9:00 p.m.</td>\r\n</tr>\r\n<tr>\r\n<td>16.</td>\r\n<td>Light off</td>\r\n<td>9:30 p.m.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div class=\"col-md-12 table-responsive\">\r\n<h3 class=\"heading-large\">KITCHEN MENU CHART</h3>\r\n<hr />\r\n<table class=\" table table-striped table-bordered\">\r\n<tbody>\r\n<tr><th scope=\"col\">Day</th><th scope=\"col\">Lunch</th><th scope=\"col\">Dinner</th></tr>\r\n<tr>\r\n<td>Sunday</td>\r\n<td>Kangtak and Chatani</td>\r\n<td>Chicken/Fish</td>\r\n</tr>\r\n<tr>\r\n<td>Monday</td>\r\n<td>Mangal and Chatani</td>\r\n<td>Vegetable</td>\r\n</tr>\r\n<tr>\r\n<td>Tuesday</td>\r\n<td>Chakwai and Chatani</td>\r\n<td>Vegetable</td>\r\n</tr>\r\n<tr>\r\n<td>Wednesday</td>\r\n<td>Kangtak/Rajma &amp; Chatani</td>\r\n<td>Egg/Panir</td>\r\n</tr>\r\n<tr>\r\n<td>Thursday</td>\r\n<td>Kangtak/Mushori &amp; Chatani</td>\r\n<td>Vegetable</td>\r\n</tr>\r\n<tr>\r\n<td>Friday</td>\r\n<td>Kangtak/Chakwai</td>\r\n<td>Eronba</td>\r\n</tr>\r\n<tr>\r\n<td>Saturday</td>\r\n<td>Kangtak/Mushori</td>\r\n<td>Vegetable</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div class=\"col-md-12 table-responsive\">\r\n<h3 class=\"heading-large\">PROGRAMMES OF EXTRA-CURRICULUMS</h3>\r\n<hr />\r\n<table class=\" table table-striped table-bordered\">\r\n<tbody>\r\n<tr>\r\n<td>1.</td>\r\n<td>Debate</td>\r\n<td>2.</td>\r\n<td>\r\n<p>Quize</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>2.</td>\r\n<td>Symposium</td>\r\n<td>4.</td>\r\n<td>Recitation</td>\r\n</tr>\r\n<tr>\r\n<td>5.</td>\r\n<td>Monoloque</td>\r\n<td>6.</td>\r\n<td>Yoga</td>\r\n</tr>\r\n<tr>\r\n<td>7.</td>\r\n<td>N.C.C.</td>\r\n<td>8.</td>\r\n<td>Choreography</td>\r\n</tr>\r\n<tr>\r\n<td>9.</td>\r\n<td>Fancy Dress</td>\r\n<td>10.</td>\r\n<td>Cultural Dance</td>\r\n</tr>\r\n<tr>\r\n<td>11.</td>\r\n<td>Music Class - Singspiration</td>\r\n<td>12.</td>\r\n<td>Mimicry</td>\r\n</tr>\r\n<tr>\r\n<td>13.</td>\r\n<td>English Spoken Class</td>\r\n<td>14.</td>\r\n<td>Physical Training (P.T.)</td>\r\n</tr>\r\n<tr>\r\n<td>15.</td>\r\n<td>Painting / Visual Stimulus</td>\r\n<td>16.</td>\r\n<td>Acting (Drama, Film)</td>\r\n</tr>\r\n<tr>\r\n<td>17.</td>\r\n<td>Annual Adventure &amp; Trekking</td>\r\n<td>18.</td>\r\n<td>Seminar on Science, Leadership/Doctor/Infantry/Civil Service/Social/Environment Science/etc.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-md-3\">\r\n<h3>MESS</h3>\r\n<p align=\"justify\">All the boys and girls dinned in a separate and well furnished common dinning hall. The cooking arrangements are supervised by a qualified mess manager. The school has fully automated ultramodern kitchen which enables preparation of hygienes wholesome food.</p>\r\n</div>\r\n<div class=\"col-md-3\">\r\n<h3>MEDICAL ATTENTION</h3>\r\n<p align=\"justify\">The health of the boys and girls are regularly attended to by a qualified Doctor assisted by a Nursing Assistant.</p>\r\n</div>\r\n<div class=\"col-md-3\">\r\n<h3>LAUNDRY SERVICE</h3>\r\n<p align=\"justify\">Laundry services are available to students. All students are required to give their clothes for washing and ironing on the days prescribed.</p>\r\n</div>\r\n<div class=\"col-md-3\">\r\n<h3>WATER SUPPLY</h3>\r\n<p align=\"justify\">The school has its own water reservoir, filtration and treatment plant. Sufficient water is made available to the dormitories in the morning and evening for bathing purposes.</p>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-md-3\">\r\n<h3>CANTEEN BOOKS &amp; STATIONERY</h3>\r\n<p align=\"justify\">In order to cater to the requirement of the students pertaining to stationery, text books, tutorials, clothing, etc. necessary arrangement exist within the school campus.The students may take various items of poet their requirement from the school canteen using &ldquo;Students Purchase Slips&rdquo;. And this amounts will be deducted from their canteen fee.</p>\r\n</div>\r\n<div class=\"col-md-3\">\r\n<h3>VISIT BY PARENTS</h3>\r\n<p align=\"justify\">Parents may visit their ward on 1st Sunday of each month between 1000 hrs. to 1600 hrs. Visits on any other day is not permitted. Parents are not permitted to bring foodstuff or their wards. Parents/visitors are expected to be on possession of their&nbsp;<span>&ldquo;Parent&rsquo;s Card&rdquo;&nbsp;</span>while visiting the school. The parent&rsquo;s card will be issued at the time of fresh admission. Any visitor whose identity is not known to, is not permitted to inter the campus.</p>\r\n<table style=\"border-color: #080705; border-width: 0px;\" border=\"0\" rules=\"rows\" align=\"left\"><caption><strong><span style=\"font-size: small;\">TELEPHONE CALL DAY FOR HOSTEL</span></strong></caption>\r\n<tbody>\r\n<tr>\r\n<td><strong>Month</strong></td>\r\n<td><strong>Date/Day</strong></td>\r\n<td><strong>Time</strong></td>\r\n</tr>\r\n<tr>\r\n<td>February</td>\r\n<td>02-02-19, Saturday</td>\r\n<td>02:30 pm - 08:00 pm</td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"2\">March&nbsp;</td>\r\n<td>02-03-19, Saturday</td>\r\n<td>- do -</td>\r\n</tr>\r\n<tr>\r\n<td>30-03-19, Saturday</td>\r\n<td>- do -</td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"2\">April&nbsp;</td>\r\n<td>06-04-19, Saturday</td>\r\n<td>- do -</td>\r\n</tr>\r\n<tr>\r\n<td>27-04-19, Saturday</td>\r\n<td>- do -</td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"2\">&nbsp;May&nbsp;</td>\r\n<td>02-05-19, Saturday</td>\r\n<td>- do -</td>\r\n</tr>\r\n<tr>\r\n<td>25-05-19, Saturday</td>\r