, well ventilated and well furnished.</p>\r\n</div>\r\n</div>\r\n<p><br /><br /></p>\r\n<h3 class=\"heading-large\">COURSE OF STUDIES</h3>\r\n<hr />\r\n<div class=\"media\">\r\n<div class=\"media-body\">\r\n<p align=\"justify\">Prescribed by the Board of Secondary Education, Manipur with Macmillan Publishers India Limited and Oxford, Guest Lecture class is organized after every half-yearly Examination.</p>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<h3 class=\"heading-large\">Exam Result:</h3>\r\n<hr />\r\n<div class=\"media\">\r\n<div class=\"media-body\">\r\n<p>The result of the Promotional/Final Examination Test will be declared on Thursday, the 28th December, 2018 at 12:00 noon through our&nbsp;<a href=\"http://www.pafathoubal.com/www.pafathoubal.com\">www.pafathoubal.com&nbsp;</a>Therefore, every student must come along with their parents/guardians to collect their mark sheets and for counselling without fail and those students who are coming without parents/guardians shall not be treated as interest.</p>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<h3 class=\"heading-large\">Academic syllabus of Class IX and X covering up:</h3>\r\n<hr />\r\n<div class=\"media\">\r\n<div class=\"media-body\">\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>The academic syllabus must be covered up in the month of July for Class X and August for Class IX. 2nd term test Exam shall be the Final Exam for class IX .</li>\r\n<li>After final exam foundation course will equipped to Class X students who are going to appear HSLC Exam in 2019 &amp; 2020.</li>\r\n<li>Revisional course is conducted from every Nov for Class X student .</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n</div>\r\n<br />\r\n<h3 class=\"heading-large\">Working Days:</h3>\r\n<hr />\r\n<div class=\"media\">\r\n<div class=\"media-body\">\r\n<p>The school mainly give full attention towards the academic regular classes. The school remained open except on the holiday list given on students Dairy, else, the school continued for regular classes.</p>\r\n</div>\r\n</div>\r\n<h3 class=\"heading-large\">ADMISSION CONCESSION</h3>\r\n<hr />\r\n<table class=\"table table-striped table-bordered\">\r\n<thead>\r\n<tr><th>Category</th><th>Admission date on or before</th><th>% to be discounted</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td rowspan=\"2\">Best fresh School &amp; Hostel Admission offer</td>\r\n<td>10th -15th December, 2018</td>\r\n<td>15%</td>\r\n</tr>\r\n<tr>\r\n<td>16th -20th December, 2018</td>\r\n<td>10%</td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"2\">Best Old School &amp; Hostel Admission offer</td>\r\n<td>20th December, 2018</td>\r\n<td>15%</td>\r\n</tr>\r\n<tr>\r\n<td>21st December, 2018</td>\r\n<td>10%</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<br />\r\n<h3 class=\"heading-large\">UNIFORM</h3>\r\n<hr />\r\n<table class=\"table table-striped table-bordered\">\r\n<thead>\r\n<tr><th>Category</th><th>Dresses</th><th>Day</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>Formal Dress (Boys)</td>\r\n<td>Grey long pant, Sky blue shirt, Grey waist coat, Blue sweater, Black shoes, Black socks, Stripped neck tie &amp; Belt</td>\r\n<td>Monday, Tuesday, Thursday &amp; Friday</td>\r\n</tr>\r\n<tr>\r\n<td>Formal Dress (Girls)</td>\r\n<td>Grey skirt (Pre-Nry to Cl-V), Grey Phanek (Cl-VI to Cl-X), Sky blue shirt, Waist coat, Blue sweater, Black shoes, Black socks, Red ribbon, Stripped Neck tie &amp; Belt</td>\r\n<td>Monday, Tuesday, Thursday &amp; Friday</td>\r\n</tr>\r\n<tr>\r\n<td>Casual Dresses (Boys)</td>\r\n<td>white longpant, Red/Blue T-shirt, White shoes, White socks, Stripped Belt</td>\r\n<td>Wednesday and Saturday</td>\r\n</tr>\r\n<tr>\r\n<td>Casual Dresses (Girls)</td>\r\n<td>Pink Phanek (Cl-VI to X), White skirt &amp; Stripped Belt (Pre-Nry to Cl-V),Red/Blue T-shirt, White shoes, White socks, Blue Ribbon</td>\r\n<td>Wednesday and Saturday</td>\r\n</tr>\r\n<tr>\r\n<td>Sport Dresses</td>\r\n<td>White short/Tracksuit, White T-shirt, Converse shoes and White socks</td>\r\n<td>On the sport day<br /><br /></td>\r\n</tr>\r\n</tbo