></td>\r\n<td style=\"text-align: center;\"><span style=\"font-family: \'times new roman\', times; font-size: x-small;\">20</span></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: right;\" colspan=\"3\"><span style=\"font-size: x-small;\"><strong><span style=\"font-family: \'times new roman\', times;\">Total Marks</span></strong></span></td>\r\n<td style=\"text-align: center;\"><span style=\"font-size: x-small;\"><strong><span style=\"font-family: \'times new roman\', times;\">120</span></strong></span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"font-size: x-small;\"><strong><span style=\"text-decoration: underline; font-family: \'times new roman\', times;\">NOTES</span></strong></span></p>\r\n<p><span style=\"font-size: x-small; font-family: \'times new roman\', times;\">1.&nbsp; &nbsp;There are 4 main Semester Examinations for 60 marks each held in the course of the year and APP for 5 marks each will be given only on 2<sup>nd</sup> and 4<sup>th</sup> Semester Examinations.</span></p>\r\n<p><span style=\"font-size: x-small; font-family: \'times new roman\', times;\">2.&nbsp; &nbsp;There 6 Class Tests for 20 marks each for the measurement of students and knowledge achievement to improve by given feedback.</span></p>\r\n<p><span style=\"font-size: x-small; font-family: \'times new roman\', times;\">3.&nbsp; &nbsp;As a rule, to secure promotion one must pass all subjects in every Tests and Examinations.</span></p>\r\n<p><span style=\"font-size: x-small; font-family: \'times new roman\', times;\">4.&nbsp; &nbsp;No Textbook, notebook or other paper must be brought to the <strong>EXAMINATION HALL</strong>. Students found copying or using unfair-means during the examination or discover subsequently will be severely punished/expelled.</span></p>\r\n<p><span style=\"font-size: x-small; font-family: \'times new roman\', times;\">5.&nbsp; &nbsp;A student who does not get at least 85% attendance, may not be allowwed to sit in the examination.</span></p>\r\n<p><s