INSERT INTO `teacher_mas` (`id`, `name`, `desig`, `content`, `photo_path`, `type`) VALUES (1,'Shri Soibam Bishworjit Singh','MANAGING DIRECTOR','<p>I believe that it is a high time to establish an educational institute with well infrastructure and standard are one of the best in the country. In this crucial juncture of Manipur, unemployment, financial crisis, law and order situation and social chaos, besides this, it is not an easy task to give a smooth academic atmosphere in our societies. Our public are crazy in cultural, religious and social festivals. They spent nearly 40n to 50 days in a year. In every section of the world their voice are educational should be treated as an essential service. Institute is a community and human resource development centre providing knowledge and information and developing skills and attitudes. Educational lead to be broadened our mind and outlook. I am in full confidence that students who are studying in this school be bold and brave to solve every problems in future lives. \" I wish my students to grow with this school. Long live Peace And Freedom Academy.</p>','md.jpg','A'),(2,'Shri Jotin Salam','PRINCIPAL','It is my endeavour to share the efforts of our institute towards achieving a formidable goal for a bright future. Educational institute as a community and Human Resource Development Centre providing knowledge and information and developing skills and altitudes needed for such development. When entering at school campus I try my best to maintain Peace mind, Equality, Freedom, Liberty and Justice among every groups of people. There is no discrimination among us. Though school occupies sole position between the school and home is useful to both sides. The school cannot achieve its goals if it does not enlist parental co-operation. With these views in mind I\'m positive that as a democratic believer we need unity and collective responsibilities. Let us therefore work hand in hand towards the achievement of goal at the same time making this school would be one of the prosperous, well infrastructure, unique educational institute as countrywide.','principal.jpg','A'),(3,'Shri Thokchom Jimo Singh ','HEADMASTER','This first thing I would like you to know about Peace And Frreedom Academy is that we give our students permission to dream big things. I extend my gratitude to all the teachers who took part in moulding the students through advice, teaching, suggestion, sacrifice, prayer and support resulting the students to have come out with the flying colours in the Board exam since 2008. As we are treading and advancing in the perilous edge to compete with the reputed schools in Manipur we should dedicate with all seriousness to win more laurels in the days to come. Today the flickering light burns brightly with boldness and spirit. There will be no more darkness and defeat if those living flame exist. So, I appeal to all the concerned subject teachers and non-teaching staffs to let their hands join and work together and learn labour and wait.','headmaster.jpg','A'),(9,'Shri Ng Koningshong Moyon','BOARDING SUPERINTENDENT','<p>Never has time been so exciting in human history as the 20th &amp; 21st Century we live in today. Human progress has been tremendous from stone age to walking on the moon achievements. On the other band, humanist and politicians have gone to cheap market and the world is under turmoil. We are living in a very crucial age. Our generation is passing through dark clouds which seem to loom over many parts of the world. Ours is a broken world today. Particularly, our state Manipur. The beautiful of the people is wrecked, purchased as commodities people\'s honesty is buried in the depth of the sea. Human dignity has been destroyed. The harmony of the state is really disturbed and traditional values are annihilated. At this juncture, reformation is needed to rebuild our fallen society. But reformation cannot be brought by talking sweet words or conjured up like magic. Perhaps the greatest institution that can change a society is school. Because a child is confined to his school compounds 8 hour</p>','hostel.jpg','A'),(8,'Smt. Premita Devi','HEADMISTRESS','','PREMITA16-05-49-14.jpg','AD'),(6,'Shri Asem Sarat Singh','CONTROLLER OF EXAMIN','','sarat.jpg','AD');
/*!40000 ALTER TABLE `teacher_mas` ENABLE KEYS */;
UNLOCK TABLES;

